import Button from 'react-bootstrap/Button';
import './Report.css';

const Report = () => {
	return(
		<div className="reportBack">
			<div className="ramenPage">
				<h1>So you want to make a report, now do you?
				</h1>
				<p className="lineBreak"></p>
				<h4>It's the moment where you want to share to the world the amazing bowl of Ramen you just ate. But wait! How do I rate something that is as complex and varied as a bowl of Ramen? How can one bowl of Ramen compare to another when there are so many aspects to Ramen? (If you are unsure what those aspects are, read up on the RAMEN KNOWLEDGE page).
				</h4>
				<p className="lineBreak"></p>
				<div className="reportButtBlock">
					<Button variant="info" className="toKnow">Read Up on More Ramen Knowledge</Button>
					<Button variant="info" className="toReport">I know the drill, I want to make a Ramen Report</Button>
				</div>
			</div>
		</div>
	)
}

export default Report;
